function ContactMe() {
    return (
        <div className="container">
            <div className="contact">
                <div className="d-flex mb-3"> 
                    <img src="/static/images/contact.png" alt="logo"/> 
                    <h1>Contact Me</h1> 
                </div> 
            </div> 
        </div> 
    )
}

export default ContactMe;
